import React from 'react';
import { Link } from 'react-router-dom';

const CRAFTS = [
  { id: 'e1', title: 'event 1' },
  { id: 'e2', title: 'event 2' },
  { id: 'e3', title: 'event 3' },
];

function EventsPage() {
  return (
    <>
      <h1>Etkinlikler</h1>
      <ul>
        {CRAFTS.map((craft) => (
          <li key={craft.id}>
            <Link to={`/events/${craft.id}`}>{craft.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
